comment:
MVA base (MVA) for the transformer (also used for shunt capacitance and feeder). The following options are provided for specifying the MVA base: 
- if the value is > 0, the the MVA base is the provided value;
- if the value is < 0, the abs(value) is the loading factor, then the MVA base = load MW / abs(value);
- if the value is = 0, the loading factor equals the default value of 0.8.
